package site.semi.dto;

public class SaleCartDTO {
	private int item_buycount,item_price,item_sale,item_num,item_boxcount;
	private String item_color,login_id,item_name;
	public SaleCartDTO() {
		// TODO Auto-generated constructor stub
	}
	
	public int getItem_boxcount() {
		return item_boxcount;
	}

	public void setItem_boxcount(int item_boxcount) {
		this.item_boxcount = item_boxcount;
	}

	public int getItem_num() {
		return item_num;
	}

	public void setItem_num(int item_num) {
		this.item_num = item_num;
	}

	public String getItem_name() {
		return item_name;
	}

	public void setItem_name(String item_name) {
		this.item_name = item_name;
	}

	public String getLogin_id() {
		return login_id;
	}

	public void setLogin_id(String login_id) {
		this.login_id = login_id;
	}

	public int getItem_buycount() {
		return item_buycount;
	}
	public void setItem_buycount(int item_buycount) {
		this.item_buycount = item_buycount;
	}
	public int getItem_price() {
		return item_price;
	}
	public void setItem_price(int item_price) {
		this.item_price = item_price;
	}
	public int getItem_sale() {
		return item_sale;
	}
	public void setItem_sale(int item_sale) {
		this.item_sale = item_sale;
	}
	public String getItem_color() {
		return item_color;
	}
	public void setItem_color(String item_color) {
		this.item_color = item_color;
	}
	
	
}
